import React from 'react'
import { useState } from 'react'
import axios from "axios"
// import { useNavigate } from 'react-router-dom'
const LoginPage = ()=>{
  const [FirstName,setFirstName]=useState()
  const [LastName,setLastName]=useState()
  const [password,setPassword]=useState()
//   const navigate=useNavigate()
  const login = async ()=>{
      const {data}= await axios.get("http://localhost:8000/users")
      let user = data.find(user =>{
          return user.FirstName==FirstName&&user.LastName==LastName&&user.password==password
      })
      if(user){
        //   navigate("/home")
        console.log("yesss")
      }
      else{
          navigate("register")
      }
  }
  return(
    <div style={{ border: "4px solid black"}}>
   
    <h1>Login Page</h1><br/>
    First name:<input type={"text"} onChange={(e)=>setFirstName(e.target.value)}/><br/>
    Last name:<input type={"text"} onChange={(e)=>setLastName(e.target.value)}/><br/>
    Password:<input type={"text"}onChange={(e)=>setPassword(e.target.value)}/><br/>
    <button onClick={login} style={{backgroundColor:"lightsalmon"}}>Login</button>
  </div>
  )
}
export default LoginPage;
